INSERT INTO `lecture` VALUES (1,'교회의 본질','김경수 목사','내가 바라고 찾는 교회는 어떤 모습입니까?  또한 교회가 교회되게 하는 요소는 무엇일까요?  우리는 이율배반적인    시대에 살고 있습니다.  아이러니컬 하게도 엉터리 같고 문제도 많은 교회가 사람들에게 각광을 받는다는 것입니다.  교회다운 교회에 대한 가르침이나 성경적인 기준이 없기 때문이기도 합니다.  이 시대의 건강하고 진실한 교회를 찾기 위한 고민과 생각을 나누어 보는 시간을 갖습니다.',0,'교회','3,6',1,'',20),(2,' 성경적 기도의 회복: 자기 중심성에서 하나님 중심성으로','최정권 목사','기도의 신비를 글이나 말로 다 설명할수 있다면 그건 진실이 아닐것이다. 사람이 하나님께 기도하고 소통할수 있다는 건 기적이고 신비다. 이 일이 우리에게 가능케하고 그것을 즐길수 있게 한 행복한 삶의 기초는 무엇 때문일까?\n기도는 의무가 아니고 짐이 아니다. 기도는 안식이고 우리에게 기쁨이고 즐거움이다. 그럼에도 기도해야 한다고 정작 기도하지 못하는 이유가 뭘까? 내 기도 생활의 장애는 무엇일까? 만일 하나님이 내가 뭐가 필요한지 다 알고 계신데 왜 기도가 필요할까? 더 본질적으로 기도란 무엇일까? 성경이 말하는 기도와 일반 종교에서 말하는 기도의 차이는 무엇인가?\n구원을 받으면 기도는 저절로 되는 건가? 아니면 훈련이 필요한 것인가? 예수님은 제자들에게 기도를 어떻게 가르치셨나? 기도는 응답이라는 결과로 그 정당성이 확보되는 것일까? 기도와 구원 그리고 성령의 삼각 관계는 무엇인가? 바쁜 내 삶속에서 얼마나 어떻게 기도해야 하나? 이 강의는 이런 문제에 대한 답을 찾아 갈것이다.',0,'기도','3,5,6',1,'',10),(3,'QT 가 왜 잘 안되지?','이창규 박사','말씀 묵상, QT, 하나님을 믿는 사람이면 누구나 들어보고, 배워보고, 실천하려고 노력해 보았을 것이다. 너무나 익숙해져 많은 기독교인들에게서 그 가치를 잃어가지만, 물질만능주의, 개인주의 , 성공주의가 만연한 이 세상에서, 예수님께서 우리를 사랑하신 것 같이 우리의 이웃을 사랑하는 삶을 살기 원하는 하나님의 자녀들에게는  없어서는 안 될, 반드시일상생활의 한 부분이 되어야 할 영적 실체, 바로 하나님과의 교제의 시간이다. 세미나를 통해, 말씀 묵상의 정의와 목적, 삶에 나타나는 열매들,기도 및 성경공부와의 관계를 포함한 그 방법들을 예를 들어 알아 보고, 생활화하는데 있어서 이겨내야 할 어려움들도 나누고자 한다. 과연  제자로서의 열매 맺는 삶의 근원이 되는 이 말씀 묵상을 꾸준히 해 나갈 수있게 하는 원동력은 무엇일까?',0,'말씀묵상','1,2,4',1,'',20),(9,'테스트 강의','테스트 강사','개요',0,'테스트 주제','1,2,3,4,5',0,'',30);
